import './Donaciones.css';


const Donaciones = () => {
  	return (
    		<div className="donaciones">
      			<div className="donaciones1">
        				<div className="donaciones2">DONACIONES</div>
        				<img className="fotonios-icon" alt="" src="fotoniños.png" />
        				<img className="donaciones-child" alt="" src="Vector 2.svg" />
      			</div>
      			<div className="este-proyecto-destina-container">
        				<p className="este-proyecto-destina">{`Este proyecto destina el 80% de las donaciones al Programa de Becas del Colegio Técnico Profesional Don Bosco, para apoyar a estudiantes que necesitan asistencia financiera. El 20% restante se utilizará para el mantenimiento de la página web del proyecto. `}</p>
        				<p className="este-proyecto-destina">&nbsp;</p>
        				<p className="este-proyecto-destina">Las donaciones se realizarán a través de PayPal. Como agradecimiento, los donantes recibirán una medalla especial en su perfil. ¡Su apoyo es fundamental para brindar oportunidades educativas y mantener nuestra plataforma en funcionamiento!</p>
      			</div>
    		</div>);
};

export default Donaciones;
